import "../styles/NavigationBar.css";
import logo from "../images/Bullbear logo.png";
import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';

function Navigationbar() {

    const state = {
        items: [],
        text: ""
      }

    function showTicker(){
        axios.get('http://127.0.0.1:8000/ticker/')
        .then((res)=>{
            console.log(res.data[0].Ticker)
            this.setState({Ticker:res.data})
        })
    }
    // showTicker()

    function addTicker(d){{
        if(d !== ""){
            axios.post('http://127.0.0.1:8000/ticker/create/',d)
            .then((res)=>{
                console.log(res.data)
            })
            .catch(error => {
                console.log(error)
            })
        }
    }
    }

    function handleSearchInputChange(event) {
        this.setState({ text: event.target.value })

    }
    function handleSearchEnter(event) {
        if(event.code == "Enter") {
            let dt = {item: this.state.text}
            addTicker(dt);
            window.location.href = '/search/:ticker';
        }
    }


    function handleSignUpClick() {
        window.location.href = '/signup';
    }

    function handleLoginClick() {
        window.location.href = '/login';
    }

    return (
        <nav>
            <div className="logo">
                <img src={logo} alt="Company Logo" />
                <h1>Bulls and Bears</h1>
            </div>
            <div className="search-bar">
                <input
                    type="text"
                    placeholder="Search your Stock here..."
                    value= {this.state.text}
                    onChange={handleSearchInputChange}
                    onKeyDown={handleSearchEnter}
                />
            </div>
            <div className="auth-buttons">
                <button onClick={handleSignUpClick}>Sign Up</button>
                <button onClick={handleLoginClick}>Log in</button>
            </div>
        </nav>
    );
}

export default Navigationbar;
